import React, { Component } from "react";
import { connect } from "react-redux";
import { searchVideogame } from "../../actions";

const GamesMap = (props) => (
  <tr>
    <td>hola</td>
  </tr>
);

export class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      title: "",
    };
  }
  handleChange(event) {
    this.setState({ title: event.target.value });
  }
  handleSubmit(event) {
    event.preventDefault();
    const tmp = this.props.getVideogame(this.state.title);
    console.log(tmp)
  }

  render() {
    return (
      <div>
        <p>Search input</p>
        <input type="text" placeholder="enter a name..."></input>
      </div>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    videogames: state.videogamesLoaded,
  };
};

const mapDispatchToProps = () => {
  return {
    getVideogame: (name) => dispatch(searchVideogame(name)),
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(Home);
